import logo from './logo.svg';
import './App.css';
import React, { Component, useState } from 'react';

class App extends Component {

  constructor() {
    super();
    this.state = {
      users:[],
      cleanTechData: 0
    }
  }

  componentDidMount() {
    this.interval = setInterval(async () => this.getCleanTechData, 1000);
  }

  componentWillUnmount() {
    clearInterval(this.interval);
  }

  getCleanTechData = async () => {
    var response = await fetch(
      'http://localhost:5281/api/cleanTechData',
      {
        method: 'get'
      }
    )

    var responsejson = await response.json();
    this.setState({
      cleanTechData: responsejson
    })
  }

  getUsers = async () => {
    var response = await fetch(
      'http://localhost:5281/api/users',
      {
        method: 'get'
      }
    )

    var responsejson = await response.json();
    this.setState({
      users: responsejson
    })
  }

  /*async getUsers() {
    fetch('http://localhost:5281/api/users').then(response=>response.json())
    .then(data=>{
      console.log(data);
      this.setState({users:data})
    })
  }*/

  render() {
    const users = this.state.users.map((item, index) => <li key={index}>{item.name}</li>)

    return (
      <div className='App'>
        <h1>{this.state.cleanTechData}</h1>
        <button onClick={this.getUsers}>getUsers</button>
        <ul>
          {users}
        </ul>
      </div>
    );
  }
}

export default App;
